#define STDOUT 0xd0580000

.section .text
.global _start
_start:

	li x1, 0xd0580000	# stdout
	j main

is_valid:
	
	# arguments:
	# a1: k
	# a2: row
	# a3: col
	
	# a4: return value (1 if true; 0 otherwise)
	
	# allocating space in stack for temp variables
	addi sp, sp, -52
	sw t0, 0(sp)
	sw t1, 4(sp)
	sw t2, 8(sp)
	sw t3, 12(sp)
	sw t4, 16(sp)
	sw t5, 20(sp)
	sw s0, 24(sp)
	sw s1, 28(sp)
	sw s2, 32(sp)
	sw a1, 36(sp)
	sw a2, 40(sp)
	sw a3, 44(sp)
	sw ra, 48(sp)
	
	not_in_row:
	
	# NON-VECTORIZED:
	
	li t0, 0			# i = 0
	li t1, 64			# 64 iterations
	
	slli t2, a2, 6		# row_offset
	add t2, a0, a3		# t2 = [base_address] + row_offset

	for_r:
		bge t0, t1, end_for_r
		
		lb t3, (t2)		# load byte element
		beq t3, a1, false	# if (element == k) then false
		
		addi t2, t2, 1		# t2 += 1 (val in next column)
		addi t0, t0, 1		# i++
		
		j for_r
		
	end_for_r:
	
	not_in_column:
	
	# NON-VECTORIZED:
	
	li t0, 0			# i = 0
	li t1, 64			# 64 iterations
	
	add t2, a0, a3		# t2 = [base_address] + col

	for_c:
		bge t0, t1, end_for_c
		
		lb t3, (t2)		# load byte element
		beq t3, a1, false	# if (element == k) then false
		
		addi t2, t2, 64		# t2 += 64 (val in next row)
		addi t0, t0, 1		# i++
		
		j for_c
		
	end_for_c:
	
	not_in_box:
	
	# NON-VECTORIZED:
	
	li t0, 8		# t0 = 8
	
	div t1, a2, t0		# t1 = row / 8
	mul t1, t1, t0		# box_r => t1 = (row / 8) * 8
	
	div t2, a3, t0		# t2 = col / 8
	mul t2, t2, t0		# box_c => t2 = (col / 8) * 8
	
	addi t3, t1, 8		# t3 = box_r + 8
	addi t4, t2, 8		# t4 = box_c + 8
	
	mv t5, t1		# i = box_r
	 
	for1:
		bge t5, t3, end_for1	# if (i == box_r + 8)
		
		slli s0, t5, 6		# s0 = row x 64 (offset)
		add s0, s0, a0		# s0 = offset + [base_address]
		
		add t6, x0, t2		# j = box_c
		
		for2:
			bge t6, t4, end_for2	# if (j == box_c + 8)
			
			add s1, s0, t6		# s1 = [row_address] + col
			lb s2, (s1)		# load byte element
			
			beq s2, a1, false	# if (grid[i][j] == k) then false
			
			addi t6, t6, 1		# k++
			j for2
			
		end_for2:
		
		addi t5, t5, 1
		j for1
		
	end_for1:
	
	true:
		addi a4, x0, 1		# return 1 (true)
		j done
	
	false:
		add a4, x0, x0		# return 0 (false)
	
	done:
		# de-allocating space in stack
		lw t0, 0(sp)
		lw t1, 4(sp)
		lw t2, 8(sp)
		lw t3, 12(sp)
		lw t4, 16(sp)
		lw t5, 20(sp)
		lw s0, 24(sp)
		lw s1, 28(sp)
		lw s2, 32(sp)
		lw a1, 36(sp)
		lw a2, 40(sp)
		lw a3, 44(sp)
		lw ra, 48(sp)
		addi sp, sp, 52
		
		jr ra
		
	
solve:

	# arguments:
	# a1: row
	# a2: col
	
	# a4: return value (1 if true; 0 otherwise)
	
	# allocating space in stack
	addi sp, sp, -12
	sw a1, 0(sp)
	sw a2, 4(sp)
	sw ra, 8(sp)

	li t1, 64
	bge a1, t1, return_true  # if (r == N) return true;

	bge a2, t1, next_row     # if (c == N) return solve(grid, r + 1, 0);

	slli t2, a1, 6		# t2 = row x 64 (row offset)
	add t2, t2, a2		# t2 += (column offset)
	add t2, a0, t2		# t2 = [base_address] + (offset)
	lb t3, 0(t2)            # t3 = grid[r][c]

	bnez t3, next_col        # if (grid[r][c] != 0) return solve(grid, r, c + 1);

	li t4, 1                 # for (int k = 1; k <= 64; k++)
	li t5, 65
	
	loop_k:
		beq t4, t5, return_false # if k == 65, return false
		
		addi sp, sp, -12
		sw a1, 0(sp)
		sw a2, 4(sp)
		sw a3, 8(sp)

		mv a3, a2	         # pass c
		mv a2, a1	         # pass r
		mv a1, t4                # a1 = k
		
		jal is_valid             # if (is_valid(grid, r, c, k))
		
		lw a1, 0(sp)
		lw a2, 4(sp)
		lw a3, 8(sp)
		addi sp, sp, 12
		
		beq a4, zero, next_k     # if not valid, continue loop

		sb t4, 0(t2)             # grid[r][c] = k;
		
		addi sp, sp, -12
		sw a1, 0(sp)
		sw a2, 4(sp)
		sw a3, 8(sp)
		
		mv a1, a1                # pass r
		addi a2, a2, 1		 # pass c + 1
		
		jal solve                # if (solve(grid, r, c + 1))
		
		lw a1, 0(sp)
		lw a2, 4(sp)
		lw a3, 8(sp)
		addi sp, sp, 12
		
		beq a3, zero, undo       # if not solved, undo change

		li a3, 1                 # return true;
		j epilogue

	undo:
		li t6, 0
		sb t6, 0(t2)             # grid[r][c] = 0;

	next_k:
		addi t4, t4, 1           # k++
		j loop_k                 # }
		
	next_row:

		addi sp, sp, -12
		sw a1, 0(sp)
		sw a2, 4(sp)
		sw a3, 8(sp)
		
		addi a1, a1, 1           # pass r + 1
		li a2, 0                 # pass 0 (start of next row)
		jal solve
		
		lw a1, 0(sp)
		lw a2, 4(sp)
		lw a3, 8(sp)
		addi sp, sp, 12
		
		j epilogue

	next_col:

		addi sp, sp, -12
		sw a1, 0(sp)
		sw a2, 4(sp)
		sw a3, 8(sp)

		# a1 unchanged	         # pass r
		addi a2, a2, 1           # pass c + 1
		jal solve
		
		lw a1, 0(sp)
		lw a2, 4(sp)
		lw a3, 8(sp)
		addi sp, sp, 12
		
		j epilogue
		
	return_false:
		li a3, 0                 # return false;
		j epilogue

	return_true:
		li a3, 1                 # return true;

	epilogue:
		# de-allocating space in stack
		lw a1, 0(sp)
		lw a2, 4(sp)
		lw ra, 8(sp)
		addi sp, sp, 12
		
		jr ra
	
main:

	li a5, 64			# actual vector length (AVL) = 64
	vsetvli t0, a5, e8, ta, ma 	# set vector length based on 8-bit element vectors
	
	# VLMAX = LMUL x (VLEN/SEW)
	# since, LMUL = 1, VLEN = 64 x 8 = 512, SEW = 8
	# VLMAX = 64
	
	# VL = min(AVL, VLMAX)
	# since, AVL = VLMAX = 64
	# VL = 64
	
	# since elements processable by hardware <= software requirement,
	# no loops required

	la a0, grid		# base_address of grid stored in a0 (global)
	
	li a1, 0		# r = 0
	li a2, 0		# c = 0
	
	jal solve		# solve(grid, 0, 0)
	
_finish:
    li x3, 0xd0580000
    addi x5, x0, 0xff
    sb x5, 0(x3)
    beq x0, x0, _finish
.rept 100
    nop
.endr

